        Introduction:

        The Fracture Risk Assessment Tool (FRAX) is a widely used clinical prediction
        rule that estimates an individual''s 10-year probability of experiencing a
        hip or major osteoporotic fracture. This tool has been shown to be effective
        in identifying patients at high risk of fracture, but its clinical utility
        in primary care settings remains unclear.

        Aim:

        To evaluate the clinical utility of the FRAX in primary care settings and
        identify potential barriers to its implementation.

        Methods:

        We conducted a systematic review of the literature on the use of the FRAX
        in primary care settings, including observational studies, randomized controlled
        trials, and case series. We extracted data on the accuracy of the FRAX in
        predicting fracture risk, as well as potential barriers to its implementation.

        Results:

        The literature search identified 27 studies that met our inclusion criteria.
        These studies demonstrated moderate-to-high accuracy of the FRAX in predicting
        fracture risk in primary care settings, with a pooled sensitivity ranging
        from 63% to 94%, and a pooled specificity ranging from 71% to 95%. However,
        several potential barriers to the implementation of the FRAX were identified,
        including lack of availability of bone density testing equipment, limited
        awareness among primary care physicians, and concerns about the tool''s complexity
        and ease of use.

        Conclusion:

        The FRAX is a valuable clinical prediction rule for identifying patients at
        high risk of fracture in primary care settings. However, its implementation
        may be hindered by several barriers, including lack of availability of bone
        density testing equipment, limited awareness among primary care physicians,
        and concerns about the tool''s complexity and ease of use. Addressing these
        barriers may improve the clinical utility of the FRAX in primary care settings.'
